import styled from "styled-components";

export const Circle = styled.svg`
    width: 150px;
    height: 150px;
    stroke: #66fcf1;
    stroke-width: 10;
    stroke-linecap: round;
    fill: none;
    > circle{

        transform: translate(5px, 5px);
        width: 100%;
        height: 100%;
        stroke-dasharray: 200;
        stroke-dashoffset: 200;
        animation: animate-circle 4s linear ;
    }

`
